import '../App.css';
import React, { useState, useEffect } from "react";
import FabricDataService from "../services/fabricServices";

function ViewStash() {
    const [stash, setStash] = useState([]);
    const [loading, setLoading] = useState(true);
    const [error, setError] = useState(null);

    useEffect(() => {
      const getStash = async () => {
        try {
          const response = await FabricDataService.getAll();
          setStash(response.stash);
          setError(null);
        } catch (err) {
          setError(err.message);
          setStash(null);
        } finally {
          setLoading(false);
        }
      };
      getStash();
    }, []);
    console.log(stash);

    return (
      <div>
          <table class="table">
              <thead class="thead-dark">
                  <tr>
                      <th>Item Id</th>
                      <th>Fabric Type</th>
                      <th>Color</th>
                      <th>Pattern</th>
                      <th>Yardage</th>
                      <th>Width</th>
                      <th>Source</th>
                      <th>Intended Project</th>
                      <th>Scrap Status</th>
                  </tr>
                </thead>
                <tbody>
                  {/* {stash.map(item => <Stash key={fabric.id} fabric={fabric} />)} */}
                </tbody>
          </table>
      </div>
    );
  }


export default ViewStash;
